import React, {useState} from 'react';
import NotAllowed from './notAllowed';
import './styles.css';

var Manager = () => {
    var [managerInfo, setManagerInfo] = useState();
    if(!sessionStorage.getItem("loggedIn")){
        return <NotAllowed />
    }
    else{
        if(!managerInfo){
            setManagerInfo(JSON.parse(localStorage.getItem('managerInfo')));
            return(
                <div>
                    <br />
                    <br />
                    <h1> مرحبا {managerInfo.name} ! </h1>
                </div>
            );
        }
        else{
            console.log(managerInfo)
            return(
                <div>
                    <br />
                    <br />
                    <h1> مرحبا {managerInfo.name} ! </h1>
                </div>
            );
        }
    }
}

export default Manager;
